import React, { useEffect, useState } from "react";

const App = () =>{

    const [num , setNum] = useState(0);
    const [nums , setNums] = useState(0);

    useEffect(()=>{
        alert('im clicked');
    })
    
    const incre = () =>{
        setNum(num+1);
        setNums(nums+1);
    }

    return(
        <>
            <button onClick={incre}> click me {num}</button>
            <button onClick={incre}> click me {nums}</button>
        </>
    )
}
export default App;
